import React from 'react';
import './App.css';
import FullCalendar from '@fullcalendar/react'; // Ensure this is only imported once
import dayGridPlugin from '@fullcalendar/daygrid';
import events from './src/events'; // Import your events data

function App() {
  return (
    <div className="App">
      <h1>Event Calendar</h1>
      <FullCalendar
        plugins={[dayGridPlugin]}
        initialView="dayGridMonth"
        events={events} // Use your events data
      />
    </div>
  );
}

export default App;
